'Action commissions'=>'Provízie sa úlohu',
'Action Commissions feature allows you to define per action, or per "anything" commissions.<br/>This way you can define commissions for example per user registration, per download, per visiting specific page, etc.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Funkcia provízia za úlohu vám umožní definovať províziu úlohu (akciu/operáciu). Týmto spôsobom môžete definovať provízie napríklad za užívateľskú registráciu, za stiahnutie, za navštívenie príslušnej stránky a podobne. <br/><a href="%s" target="_blank">Viac sa dočítate v našej dokumentácií</a>.',
'More help in our Knowledge Base'=>'Viac sa dočítate v našej dokumentácií.',
'Banner rotator is a special type of banner that rotates other banners.<br/>When affiliate inserts rotator to his page, the rotator displays banners that are assigned to the rotator, so the visitor will see another banner every time he visits the affiliates page.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Obmienač banerov je špeciálny typ banerov, ktorý postupne obmieňa ostatné banere. Akonáhle partner vloží tento baner do svojej stránky, začnú sa mu zobrazovať všetky banere, ktoré sú do neho priradené, takže návštevník každou návštevou partnerovej stránky uvidí iný baner. <br/><a href="%s" target="_blank">Viac sa dočítate v našej dokumentácií</a>.',
'Branding free'=>'Odstránenie obchodnej značky',
'Branding Free is a special feature that allows you to change the links in the footer of panels and signup form from "Powered by %s" to your own text and link.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Odstránenie obchodnej značky je špeciálna funkcia, ktorá vám umožní zmeniť odkazy v pätičke stránky a v registračnom formulári z "Powered by %s" na váš vlastný text a odkaz.<br/><a href="%s" target="_blank">Viac sa dočítate v našej dokumentácií</a>',
'Commission Groups'=>'Provízne skupiny',
'Commission groups allow you to set different commissions for different users for the same campaign.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Provízne skupiny vám umožňujú v rovnakej kampani nastaviť rozdielne provízie pre rozdielnych partnerov.<br/><a href="%s" target="_blank">Viac sa dočítate v našej dokumentácií</a>.',
'CPM commissions'=>'CPM provízie',
'CPM (cost per mille) commissions are a special type of commissions that are rewarded for 1000 impressions, which means for displaying your banners 1000 times.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'CPM je špeciálny druh provízie, ktorá odmeňuje vašich partnerov za 1000 zobrazení čo znamená zobrazenie vašich banerov 1000 krát.<br/><a href="%s" target="_blank"Viac sa dočítate v našej dokumentácií.</a>',
'Forced matrix allows you to limit to the number of referrals of subaffiliates any affiliate can refer. It means that every affiliate can have only specified number of children. <a href="%s" target="_blank">More details read in our Knowledge Base</a>'=>'Vynútená matica vám umožňuje kontrolovať počet odkázaných podradených partnerov vašich partnerov. To znamená, že každý partner môže mať iba určitý počet podradených partnerov.  <a href="%s" target="_blank">Viac sa dočítate v našej dokumentácií.</a>',
'Hosting of %s on  %s servers.'=>'Hosting %s na  %s serveroch.',
'Multiple currencies allow you to track sales in multiple currencies.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Viaceré meny vám umožňujú sledovať predaje v rôznych menách.<br/><a href="%s" target="_blank">Viac sa dočítate v našej dokumentácií</a>.',
'Multiple merchants'=>'Podpora viacerých obchodníkov',
'By default, all campaigns in %s are public, which means that all affiliates can view and promote them. Private campaigns feature allows you to create private campaigns, which will be visible only to selected affiliates.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Všetky kampane v systéme %s sú predvolenom v stave verejné čo znamená, že všetci partneri ich môžu vidieť a propagovať. Táto funkcia vám možní vytvárať súkromné kampane, ktoré sú viditeľné iba vybraným partnerom. <br/><a href="%s" target="_blank">Viac sa dočítate v našej dokumentácií</a>.',
'It alows you to create a special type of promo materials - rebrandable e-books. You can create your PDF e-book only once and upload it to %s.Your affiliates will automatically get their own re-branded copy of the book, with their name, affiliate links, texts, etc. There is no need to run any Windows program for branding, they will simply download rebranded PDF. All the rebranding is made automatically in the background.<br/><a href="%s" target="_blank">%s</a>'=>'Vám umožňuje vytvoriť špeciálny typ propagačných materiálov - knihy pod vlastnou značkou. Môžete si raz vytvoriť vaše PDF a nahrať ho do %s. Vaši partneri automaticky získajú svoju vlastnú kópiu knihy s ich menom, partnerským odkazom, textami a podobne. Nie je nutné používať žiadny externý program na vytváranie vlastnej značky. Jednoducho si stiahnu PDF s vlastnou značkou. Celý proces vytvárania vlastnej značky je automatický a je na pozadí. <br/><a href="%s" target="_blank">%s</a>
',
'Recurring commissions allow you to reward your affiliates for recurring payments, for example for hosting or membership. <br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Opakujúce sa provízie vám umožňujú odmeňovať vašich partnerov za opakujúce sa platby ako napríklad webhostingove služby či rôzne členstvá. <br/><a href="%s" target="_blank">Viac sa dočítate v našej dokumentácií</a>.',
