'Plugin is possible to activate only in case database user used for connecting to database of %s has rights to read from system table INFORMATION_SCHEMA.TABLES.'=>'Plugin je možné aktivovať iba v prípade, že užívateľ použitý na pripojenie databázy systému %s má práva na čítanie zo systémovej tabuľky INFORMATION_SCHEMA.TABLES.',
